import React from "react";
import { Link, useNavigate } from "react-router-dom";


export default function Navbar() {

  const usenavigate = useNavigate();
  
  const handleFileUpload = () => {
    navigate(`/upload?display='download'`);
  };

    const handleFileDownload = () => {
      navigate(`/userhome?display='upload'`);
    };

  const handleLogOut = () => {
    localStorage.removeItem("authToken");
    usenavigate("/");
  };

return(
    <div>
      <nav className="navbar navbar-expand-lg navbar-dark " style={{"backgroundColor": "#e3f2fd"}}>
        <div className="container-fluid">
          <Link className="navbar-brand fs-1 fst-italic text-black" to="/">
            ShareEase
          </Link>
          <button
            className="navbar-toggler"
            type="button"
            data-bs-toggle="collapse"
            data-bs-target="#navbarNav"
            aria-controls="navbarNav"
            aria-expanded="false"
            aria-label="Toggle navigation"
          >
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav me-auto mb-2">
              <li className="nav-item ">
                <Link className="nav-link active text-black" aria-current="page" to="/">
                  
                </Link>
              </li>
             
            </ul>
            {!localStorage.getItem("authToken") ? (
              <div className="d-flex">
              <Link className="btn bg-white  mx-1" to="/login">
                Login
              </Link>

              <Link
                className="btn bg-white  mx-1"
                to="/signup"
              >
                Sign Up
              </Link>
            </div>
            ):(
              <div className="d-flex">
                <Link
                className="btn bg-white  mx-1"
                onClick={handleFileDownload}
              >
                My Uploaded Files
              </Link>
                <button className="btn bg-white  mx-1" onClick={handleLogOut}>
                  Logout
                </button>
                
              </div>
            )}
              
          </div>
        </div>
      </nav>
    </div>
  );
}
